import React from "react";
import Heading from "./main_items/Heading"
import LightButton from "./main_items/Button";
import FluidImage from "./main_items/FluidImage";

function App(){
    const handleCli = async () => {
        try {
            // Make a GET request to the /call endpoint on the server
            const response = await fetch("/call");

            // Check if the response is ok (status code 200-299)
            if (response.ok) {
                // If the response is ok, do something with the response
                console.log("Server call successful");
            } else {
                // If the response is not ok, throw an error
                throw new Error(`Server call failed: ${response.statusText}`);
            }
        } catch (error) {
            // Handle errors if any
            console.error("Error:", error);
        }
    };
    return (
        <div className="main-page">
            <div className="main-image">
            <FluidImage url={"https://cdn.pixabay.com/photo/2018/12/10/02/14/manhattan-3866140_1280.jpg"} />
            </div>
            <div className="main-components">
            <Heading content={"Welcome to the CS Quiz"}/>
            <a href="/cs"><LightButton text="Get Started"/></a>
            </div>
        </div>
    )
}

export default App;
